export const REQUEST_HELLO_WORLD = 'HELLOWORLD';
export const RECEIVE_HELLO_WORLD = 'HELLOWORLD';

export const requesthelloworld = () => ({type: REQUEST_HELLO_WORLD});
export const receivethelloworld = text => ({type: RECEIVE_HELLO_WORLD, text});
